import React from "react";

const Test = () => {
    const [checked, setChecked] = React.useState(false);
  
    const handleChange = () => {
      setChecked(!checked);
    };
  
    return (
      <div>
        <label>
          <input
            type="checkbox"
            checked={checked}
            onChange={handleChange}
          />
          My Value
        </label>
  
        <p>Is "My Value" checked? {checked.toString()}</p>
      </div>
    );
  };

